    # ================== Sync Local App ======================
    def sync_local_scan_time(self, cr, uid, context={}):
        orm_scan_time = self.pool.get('feosco.scan.time')
        scan_time_ids = orm_scan_time.search(cr, uid, [('active_scan', '=', True)])
        if scan_time_ids:
            return True
        else:
            return False

    def sync_local_get_all_user_with_acc(self, cr, uid, context={}):
        orm_user =  self.pool.get('res.users')
        user_ids = orm_user.search(cr, uid, [('active','=',True)])
        user_list = orm_user.read(cr, uid, user_ids,['id','login','password'])
        user_list_dump=[]
        for user_id in user_list:
            user_id.pop("groups_id",None)
            user_list_dump.append(user_id)
        return json.dumps(user_list_dump)
    
    def sync_local_app_merge(self, cr, uid, val, context={}):
        self.__logger.info('Begin sync_local_app_merge')
        self.__logger.info(val)
        orm_categ = self.pool.get('account.asset.category')
        orm_user = self.pool.get('res.users')
        orm_barcode = self.pool.get('feosco.barcode.type')
        orm_department =  self.pool.get('feosco.asset.department')

        categ_ids = orm_categ.search(cr, uid, [('name', '=', val.get('category'))])
        user_ids = orm_user.search(cr, uid, [('name', '=', val.get('owner'))])
        barcode_ids = orm_barcode.search(cr, uid, [('name', '=', val.get('barcodeType'))])
        depart_ids = orm_department.search(cr, uid, [('name', '=', val.get('department'))])
        dictReturn = {
            'category_id': categ_ids[0] if categ_ids else None,
            'feosco_user_id': user_ids[0] if user_ids else None,
            'feosco_barcode_type': barcode_ids[0] if barcode_ids else None,
            'feosco_asset_department_id': depart_ids[0] if depart_ids else '',
        }
        self.__logger.info(dictReturn)
        return dictReturn

    def sync_local_app_create_scan(self, cr, uid, vals, context={}):
        self.__logger.info('--> begin sync_local_app_create_scan')
        """
         [{
         u'category': u'B\u1ea3o tr\xec b\u1ea3o d\u01b0\u1ee1ng - 3 N\u0103m',
         u'photo_data': u'',
         u'photo_name': u'brother',
         u'name': u'bdefgh',
         u'purchase_value': u'1',
         u'feosco_code': u'BD1357',
         u'department': u'P.DICH VU 4',
         u'status': u'Good',
         u'owner': u'Administrator'
         }]
        """
        orm_asset = self.pool.get('account.asset.asset')
        orm_status = self.pool.get('feosco.asset.status')
        orm_scan =  self.pool.get('feosco.asset.scan')
        orm_scan_time =  self.pool.get('feosco.scan.time')
        scan_time_ids = orm_scan_time.search(cr, uid, [('active_scan', '=', True)])
        self.__logger.info(vals)
        mess = ''
        sum = len(vals)
        count = 0
        for val in vals:
            vals_new = {
                'feosco_image': val.get('photo_data'),
                'feosco_code': val.get('feosco_code'),
                'name': val.get('name'),
                'purchase_value': int(val.get('purchase_value')),
                'state': 'open',
                'feosco_scan_time_id': scan_time_ids[0] if scan_time_ids else None,

            }
            val_update = self.sync_local_app_merge(cr, uid, {
                'category': val.get('category'),
                'branch': val.get('branch'),
                'building': val.get('building'),
                'floor': val.get('floor'),
                'owner': val.get('owner'),
                'barcodeType': val.get('feosco_barcode_type'),
                'department': val.get('department'),

            })
            if not val_update.get('category_id'):
                self.__logger.error('error: sync category, have not category before sync app, please sync app')
                if not mess:
                    mess += 'error: sync category, have not category before sync app, please sync app'
                else:
                    mess += '--'
                    mess += 'error: sync category, have not category before sync app, please sync app'

            else:
                vals_new.update(val_update)
                if val.has_key('status') and val.get('status'):
                    status_ids = orm_status.search(cr, uid, [('name', '=', val.get('status'))])
                    if status_ids:
                        vals_new['feosco_status_id'] = status_ids[0]
                self.__logger.info(vals_new)
                asset_id = orm_asset.create(cr, uid, vals_new, context=context)
                if not mess:
                    mess += '%s sync ok' % asset_id
                else:
                    mess += '--'
                    mess += '%s sync ok' % asset_id
                count += 1
                self.__logger.info('--> create new asset is Ok')

        if sum != count:
            code = 0
            self.__logger.error('false create total line : %s' % (sum - count))
            self.__logger.error('--> end sync_local_app_create_scan')
            return {
                'code': code,
                'message': mess
            }
        else:
            self.__logger.info('sync create new asset total %s is Ok' % (sum))
            self.__logger.info('--> end sync_local_app_create_scan')
            code = 1
            return {
                'code': code,
                'message': mess
            }

    def sync_local_app_update_scan(self, cr, uid, vals, context={}):
        """
        :param cr:
        :param uid:
        :param vals: [{"asset_id":98,"status":"normal","photo_update":"base64"},{"asset_id":99,"status":"Good","photo_update":"base64"}]
        :param context:
        :return:
        """
        self.__logger.info('--> BEGIN sync_local_app_update_scan')
        self.__logger.info(vals)

        orm_asset = self.pool.get('account.asset.asset')
        orm_scan = self.pool.get('feosco.asset.scan')
        orm_asset_scan = self.pool.get('feosco.asset.status')
        orm_scan_time =  self.pool.get('feosco.scan.time')
        scan_time_ids = orm_scan_time.search(cr, uid, [('active_scan', '=', True)])

        mess = ''
        sum = len(vals)
        count = 0
        for val in vals:
            asset_ids = orm_asset.search(cr, uid, [('id', '=', val.get('asset_id'))])
            status = val.get('status')
            image_scan_base64 = val.get('photo_update')
            if asset_ids:
                orm_scan.create(cr, uid, {
                    'asset_id': val.get('asset_id'),
                    'name': val.get('status'),
                    'note': status,
                    'image':image_scan_base64
                })
                status_id = False
                status_ids = orm_asset_scan.search(cr, uid, [('name', '=', status)])
                self.__logger.info('--> status_ids: %s' % status_ids)
                if status_ids:
                    status_id = status_ids[0]
                else:
                    status_id = orm_asset_scan.create(cr, uid, {'name': status})
                vals_update = {
                    'feosco_status_id': status_id,
                    'feosco_scan_time_id': scan_time_ids[0] if scan_time_ids else None
                    }
                orm_asset.write(cr, uid, val.get('asset_id'), vals_update)
                
                count += 1
                if not mess:
                    mess += '%s create Done' % (val.get('asset_id'))
                else:
                    mess += ','
                    mess += '%s create Done' % (val.get('asset_id'))
            else:
                if not mess:
                    mess += 'error asset_id %s because can not find this' % val.get('asset_id')
                else:
                    mess += ','
                    mess += 'error asset_id %s because can not find this' % val.get('asset_id')
        if sum != count:
            code = 0
            self.__logger.error('--> false update total line : %s' % (sum - count))
            self.__logger.error('--> END sync_local_app_update_scan')
            return {
                'code': code,
                'message': mess
            }
        else:
            self.__logger.info('--> sync update new asset total %s is Ok' % (sum))
            self.__logger.info('--> END sync_local_app_update_scan')
            code = 1
            return {
                'code': code,
                'message': mess
            }


    def sync_local_app(self, cr, uid, jsondatas, context={}):
        self.__logger.info('===> BEGIN sync_local_app')
        datas = json.loads(jsondatas)
        self.__logger.info(datas)
        sync = {'code': 0, 'message': ''}
        mess = {'code': 0, 'message': ''}
        for vals in datas:
            news = vals.get('new_list') if vals.has_key('new_list') else []
            updates = vals.get('update_list') if vals.has_key('update_list') else []
            if news:
                sync = self.sync_local_app_create_scan(cr, uid, news, context=context)
                self.__logger.info('--> sync: %s' % sync)
                if sync.has_key('code') == 0:
                    return sync
            if updates:
                mess = self.sync_local_app_update_scan(cr, uid, updates, context=context)
                self.__logger.info('--> mess: %s' % mess)
        self.__logger.info('===> END sync_local_app')
        return json.dumps(
            {
            'new_list': {'code': sync.get('code'), 'message': sync.get('message')},
            'update_list': {'code': mess.get('code'), 'message': mess.get('message')},
            }
        )

