    def post_data_to_asset(self, cr, uid, vals, context={}):
        """

        :param cr:
        :param uid:
        :param vals: [{"photo_name":"brother","photo_data":"","feosco_barcode_type":"EAN13","feosco_code":"0000000000017","name":"tttt","category":"B\u1ed9 \u0111\u00e0m , pin s\u1ea1c","owner":"_none","status":"_none","branch":"_none","building":"","floor":"","purchase_value":"1"}]
        data merge:
        {'feosco_image': u'', 'feosco_code': u'0000000000017', 'name': u'tttt', 'purchase_value': u'1', 'category_id': 3, 'feosco_barcode_type': None}
        :param context:
        :return:
        """
        self.__logger.info('begin post_data_to_asset')
        self.__logger.info('vals push me: %s' % vals)
        vals_list = json.loads(vals)
        orm_categ = self.pool.get('account.asset.category')
        orm_user = self.pool.get('res.users')
        orm_asset = self.pool.get('account.asset.asset')
        orm_status = self.pool.get('feosco.asset.status')
        orm_barcode = self.pool.get('feosco.barcode.type')
        orm_department = self.pool.get('feosco.asset.department')
        for vals in vals_list:
            data = {}
            if vals.get('category') and vals.has_key('category'):
                categ_ids = orm_categ.search(cr, uid, [('name', '=', vals.get('category'))])
                if categ_ids:
                    data['category_id'] = categ_ids[0]
                else:
                    categ_ids = orm_categ.search(cr, uid, [])
                    categNew_id = orm_categ.copy(cr, uid, categ_ids[0])
                    orm_categ.write(cr, uid, [categNew_id], {'name': vals.get('category') })
                    data['category_id'] = categNew_id
            if not data['category_id']:
                self.__logger.error('can not create or search categ')
                return False
            if vals.has_key('owner') and vals.get('owner'):
                user_ids = orm_user.search(cr, uid, [('name', '=', vals.get('owner'))])
                if user_ids:
                    data['feosco_user_id'] = user_ids[0]
            if vals.has_key('status') and vals.get('status'):
                status_ids = orm_status.search(cr, uid, [('name', '=', vals.get('status'))])
                if status_ids:
                    data['feosco_status_id'] = status_ids[0]

            data.update({
                'name': vals.get('name'),
                'feosco_image': vals.get('photo_data'),
                'feosco_code': vals.get('feosco_code'),
                'feosco_barcode_type': orm_barcode.search(cr, uid, [])[0] if orm_barcode.search(cr, uid, []) else None,
                'purchase_value': vals.get('purchase_value') if vals.has_key('purchase_value') else 0.00,
                'state': 'open',
            })
            depart_ids = orm_department.search(cr, uid, [('name', '=', vals.get('department'))])
            if depart_ids:
                data.update({'feosco_asset_department_id': depart_ids[0]})
            if vals.has_key('feosco_barcode_type') and vals.get('feosco_barcode_type'):
                code_ids = self.pool.get('feosco.barcode.type').search(cr, uid, [('code', '=', vals.get('feosco_barcode_type'))])
                data.update({
                    'feosco_barcode_type': code_ids[0] if code_ids else None
                })
            if not vals.has_key('feosco_barcode_type') or not vals.get('feosco_barcode_type'):
                self.__logger.error('Can not find barcode type')
                code_ids = self.pool.get('feosco.barcode.type').search(cr, uid, [('code', '=', 'Code128')])
                data.update({
                    'feosco_barcode_type': code_ids[0] if code_ids else None
                })
            self.__logger.info('data merge: %s' % data)
            orm_asset.create(cr, uid, data)

        self.__logger.info('end post_data_to_asset')
        return True

    def printer_get_all_asset(self, cr, uid, context=None):
        asset_pool = self.pool.get('account.asset.asset')
        print_pool = self.pool.get('feosco.print.asset')
        
        search_agrs = [('create_uid', '=', uid)]
        print_ids = print_pool.search(cr, uid, search_agrs, context=context)
        
        print_assets = []
        if print_ids:
            print_asset_obj = print_pool.browse(cr, uid, print_ids, context=context)
            
            for print_asset in print_asset_obj:
                asset = asset_pool.browse(cr, uid, print_asset.asset_id.id, context=context)
               
                if asset.feosco_barcode_type and asset.feosco_code:
                    ass = {
                           'feosco_barcode_type': asset.feosco_barcode_type.code,
                           'feosco_code': asset.feosco_code,
                           'feosco_location': asset.feosco_location,
                           'feosco_stock': asset.feosco_stock,
                           'feosco_unit': asset.feosco_unit,
                           'department': asset.feosco_asset_department_id.name if asset.feosco_asset_department_id else '',
                           'name': asset.name,
                           'id': asset.id, 
                           'print_type': print_asset.print_type,
                           }
                    print_assets.append(ass)

        print_pool.unlink(cr, uid, print_ids)
        return json.dumps(print_assets)


    def get_all_asset(self, cr, uid, context=None):
        self.__logger.info('===> begin get_all_asset')
        asset_obj = self.pool.get('account.asset.asset')
        assets_ids = asset_obj.search(cr, uid, [('feosco_print', '=', True)], context=context)
        self.__logger.info('---> assets_ids %s' % assets_ids)
        assets = asset_obj.read(cr, uid, assets_ids, ['feosco_code', 'name', 'feosco_barcode_type'])
        self.__logger.info('--> assets: %s' % assets)
        asset_obj.write(cr, uid, assets_ids, {'feosco_print': False})
        self.__logger.info('===> end get_all_asset')
        return json.dumps(assets)

    def get_data_from_barcode(self, cr, uid, datas):

        self.__logger.info('===> begin get_data_from_barcode')
        self.__logger.info(datas)
        asset_obj = self.pool.get('account.asset.asset')
        valReturn = {}
        if datas and datas.has_key('barcode'):
            code = datas.get('barcode')
            assets_ids = asset_obj.search(cr, uid, [('feosco_code', '=', code)])
            if assets_ids and len(assets_ids) == 1:
                data = asset_obj.read(cr, uid, assets_ids[0],
                    [
                        'id',
                        'feosco_code',
                        'feosco_status_id',
                        'name',
                        'state',
                        'feosco_user_id',
                        'feosco_asset_department_id',
                    ]
                )
                valReturn = {
                    'code': data.get('feosco_code'),
                    'department': data.get('feosco_asset_department_id')[1] if data.get('feosco_asset_department_id') and len(data.get('feosco_asset_department_id')) == 2 else '',
                    'owner': data.get('feosco_user_id')[1] if data.get('feosco_user_id') and len(data.get('feosco_user_id')) >=2 else '',
                    'name': data.get('name'),
                    'status': data.get('feosco_status_id')[1] if data.get('feosco_status_id') and len(data.get('feosco_status_id')) >=2 else '',
                    'id': data.get('id'),
                }
            else:
                self.__logger.error('error , can not find asset with code: %s' % code)
        else:
            self.__logger.error('error , can not find value or key [barcode]')
        self.__logger.info(valReturn)
        self.__logger.info('===> end get_data_from_barcode')
        return json.dumps(valReturn)

