    def get_count_asset(self, cr, uid, context={}):
        orm_asset = self.pool.get('account.asset.asset')
        asset_ids = orm_asset.search(cr, uid, [])
        vals = {
            'draft': 0,
            'open': 0,
            'close': 0,
        }
        for asset in orm_asset.browse(cr, uid, asset_ids):
            if asset.state == 'draft':
                vals['draft'] += 1
            if asset.state == 'open':
                vals['open'] += 1
            if asset.state == 'close':
                vals['close'] += 1
        return json.dumps(vals)


